import { newAllQuestionKeyCombinationArray } from "./keyCreator";
let emptyKeyArray = [
  "recruitment_and_placement",
  "is_this_a",
  "the_srps_use",
  "relevant_information_on",
  "the_seafarers_recruited",
  "operation_of_recruitment",
  "charged_directly_to",
  "similar_personal_travel",
  "visa_shipowner_must",
  "bear_in_the",
  "any_fees_for",
  "uptodate_register_of",
  "given_to_the",
  "system_which_should",
  "can_be_contacted",
  "sympathetically_and_at",
  "no_seafarer_under",
  "the_srps_have",
  "have_a_procedure",
  "under_their_employment",
  "relevant_knowledge_of",
  "ensure_that_seafarers",
  "or_should_confirm",
  "receive_a_signed",
  "collective_agreements_where",
  "the_job_concerned",
  "srps_is_authorized",
  "by_the_srps",
  "complies_with_the",
  "in_a_foreign",
  "the_administration_of",
  "ship_required_to",
  "monetary_loss_that",
  "order_to_ensure",
  "have_procedures_in",
  "have_a_policy",
  "are_verified_required",
];

function StructureCreator({ serialNo, question, num, keyCreator, extraField }) {
  keyCreator(question);
  console.log(extraField, "Extrafield");

  const structureHTML = `
    <div class="section">
              <div class="rows">
                <div class="col-1 text-center">
                  <p class="num-label">${serialNo}</p>
                </div>
                <div class="col-11">
                  <label class="ors-form-label">${question}</label>
                  <div class="rows">
                    <div class="col-3 main-radio" data-fieldtype="radio-group" data-bind="foreach:{
                        data:[
                          {id:'yes',label:'Yes'},
                          {id:'no',label:'No'}
                        ],
                        as:'option'
                      }">
                      <div class="radio-common"
                        data-bind="css:{'selected':vm.formData.${
                          emptyKeyArray[num - 1]
                        }()===option.id}">
                        <input type="radio" name="${
                          emptyKeyArray[num - 1]
                        }" data-bind="
                            checkedValue: option.id,
                            checked: vm.formData.${
                              emptyKeyArray[num - 1]
                            }, 
                            attr:{
                              id:'${
                                emptyKeyArray[num - 1]
                              }'+'-'+option.id,disabled:vm.isReadOnlyField('${
    emptyKeyArray[num - 1]
  }')
                            }" />
                        <label
                          data-bind="text:option.label, attr:{for:'${
                            emptyKeyArray[num - 1]
                          }'+'-'+option.id}"></label>
                      </div>
                    </div>
                    <div class="col-9 ors-form-control textarea-input" data-fieldtype="textarea">
                      <textarea class="textarea-text" name="${
                        emptyKeyArray[num - 1]
                      }_remarks"
                        placeholder="Remarks by Auditor" style="height: 30px;"
                        data-bind="expandable:{min:1},value:vm.formData.${
                          emptyKeyArray[num - 1]
                        }_remarks,attr:{readonly:vm.isReadOnlyField('${
    emptyKeyArray[num - 1]
  }_remarks')}"></textarea>
                    </div>
                  </div>
                </div>
              </div>
            </div>
               `;
  return (
    <>
      {structureHTML} <br />
    </>
  );
}
export default StructureCreator;
